data.description:
Navigate an object and it's and set all empty strings to null

This cropped up as a requirement for posting data to DynamoDB.


Example `obj`

```
{
    test: '',
    aNumber: 14,
    aBool: true,
    aString: 'blah@example.com',
    email: 'blah@example.com',
    anObject: {
        testOne: '',
        otherNumber: 14,
        otherBool: true,
        otherString: 'blah@example.com',
        testAnotherObject: {
            testTwo: '',
        },
    },
    anArray: [
        {
            testThree: '',
            testAnotherObject: {
                testFour: '',
            },
        },
        {
            testFive: '',
            testAnotherObject: {
                testSix: '',
            },
        },
    ],
    aNumberArray: [
        1, 2, 3
    ],
    aStringArray: [
        'One', 'Two', 'Three'
    ]
}
```

Returned result
```
{
    test: null,
    aNumber: 14,
    aBool: true,
    aString: 'blah@example.com',
    email: 'blah@example.com',
    anObject: {
        testOne: null,
        otherNumber: 14,
        otherBool: true,
        otherString: 'blah@example.com',
        testAnotherObject: {
            testTwo: null,
        },
    },
    anArray: [
        {
            testThree: null,
            testAnotherObject: {
                testFour: null,
            },
        },
        {
            testFive: null,
            testAnotherObject: {
                testSix: null,
            },
        },
    ],
    aNumberArray: [
        1, 2, 3
    ],
    aStringArray: [
        'One', 'Two', 'Three'
    ]
}
```
